  return (
  <C.Content>
    <form>
        <input 
        type="text" 
        value={valueInput}
        autoComplete='off'  
        placeholder='Escrever nome'
        onChange={handleChange}
        />
        <button type="submit">+</button>
    </form>
        <button className='bt-sortear'>SORTEAR AGORA</button>
  </C.Content>

  );
}
